import styled from "styled-components";

export const PokeListContainer = styled.main`
    max-width: 100vw;
    /* max-height: 100vh; */
    display: grid;
    grid-template-rows: repeat(6, 1fr);
    grid-template-columns :repeat(4, 1fr) ;
    row-gap: 15px;
    column-gap: 5px;
    justify-items: stretch;
    align-items: stretch;
    background-color: rgba(10,40,95,.9);
    padding-top: 15px;
`;
